package com.mkpits.array;

public class MultidimensionalArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
 
		String [][] multidimensional = {{"Mr","Mrs"},{"Aatish","Samiksha"}};
		
		for (int i = 0; i < 1; i++) {
			for (int j = 0; j < 1; j++) {
				
				System.out.println(multidimensional[0][1] + " " + multidimensional[1][1] );
				System.out.println(multidimensional[0][0] + " " + multidimensional[1][0]);
			}
			
		}
		
	} 
}


